import React, { useState, useEffect } from 'react';
import { Link } from 'react-router-dom';
import styles from './SuperAdminDashboard.module.css';
import axios from 'axios';

const SuperAdminDashboard = () => {
  const [requests, setRequests] = useState([]);
  const [totalResidents, setTotalResidents] = useState(0);

  useEffect(() => {
    axios.get('http://localhost:8080/requests')
      .then(response => setRequests(response.data))
      .catch(error => console.error('Error fetching requests:', error));

    axios.get('http://localhost:8080/users/count')
      .then(response => setTotalResidents(response.data))
      .catch(error => console.error('Error fetching resident count:', error));
  }, []);

  const totalRequests = requests.length;
  const completed = requests.filter(r => r.status === 'Completed').length;
  const pending = requests.filter(r => r.status === 'Pending').length;

  return (
    <div className={styles.container}>
      <h2>Super Admin Dashboard</h2>
      <div className={styles.cards}>
        <div className={styles.card}>
          <h4>Total Requests</h4>
          <p>{totalRequests}</p>
        </div>
        <div className={styles.card}>
          <h4>Completed</h4>
          <p>{completed}</p>
        </div>
        <div className={styles.card}>
          <h4>Pending</h4>
          <p>{pending}</p>
        </div>
        <div className={styles.card}>
          <h4>Total Residents</h4>
          <p>{totalResidents}</p>
        </div>
      </div>
      <Link to="/reports"><button className={styles.reportsButton}>Go to Reports</button></Link>
    </div>
  );
};

export default SuperAdminDashboard;
